import React, { useState } from "react";
import { apiCall } from './utils/apiCall';


function Home() {

    const [student, setStudent] = useState('');
    const [test, setTest] = useState('');

    function getStudents(){
        apiCall('/user/student', 'get').then(res=>{
            setStudent(res.data)
        })
    }

    function getTest(){
        apiCall('/user/test', 'get').then(res=>{
            setTest(res.data)
        })
    }


    return (
        <div className="row">
            <div className="container d-flex justify-content-center">
                <div className="card col-5 mt-5">
                    {
                        student
                    }

                    {
                        test
                    }
                    <button className="btn btn-info">student</button>
                    <button className="btn btn-info mx-2">test</button>
                </div>
            </div>
        </div>
    )
}

export default Home;
